package com.project.generator;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Controller;import org.springframework.ui.Model;import org.springframework.web.bind.annotation.GetMapping;import com.project.generator.module.generate.pojo.GenerateModuleQO;import com.project.generator.module.generate.service.GenerateModuleService;@Controllerpublic class ProjectIndexController {    @Autowired    private GenerateModuleService baseService;    @GetMapping({"/","list"})    public String index(Model model) {        model.addAttribute("moduleList" , baseService.getVOList(new GenerateModuleQO()));        return "index";    }    @GetMapping({"create"})    public String create(Model model) {        return "create";    }}